import React from "react";
import TodoItem from "./TodoItem";
import './App.css';

export default class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            todoItems: [
                {titles: 'Item 1', description: '', completed: true},
                {titles: 'Item 2', description: '', completed: false},
                {titles: 'Item 3', description: '', completed: false},
            ]
        };
    }
    render() {
        let items = this.state.
        return (
        <div className="container">
            <div className="mt-2 mb-5">Todo creation</div>
            <div>
                <TodoItem 
                    title="Item 1" 
                    description="Item 1 description" 
                    completed={true} 
                />
                <TodoItem 
                    title="Item 2" 
                    description="Item 2 description" 
                    completed={false} 
                />
            </div>
        </div>
        );
    }
}
